import React, { Component } from 'react';
import API from './API/API';
import './App.css';

class App extends Component {
	constructor() {
		super();
    this.api = new API();
    this.state={
      data:"no data"
    }
    this.api.getData().then(res=>this.setState({data:res}));
  }

  componentDidMount(){

  }

	render() {
		return (
			<React.Fragment>
				<h3>STATBOY</h3>
				{Object.values(this.state.data).map(d=><h3>{d.text}</h3>)}
			</React.Fragment>
		);
	}
}

export default App;
